import React, {props} from "react";

function List() {
    const filteredData = props.filterType === 'showCompleted' ? props.data : props.data.filter(item => !item.completed)
    return(
        <div>
            {filteredData.map((item, i) => (
                <div class = "input" id={i}>
                    <input type="checkbox"/>
                    <label><h1>{item.todo}</h1></label>
                </div>
            ))}
        </div>
    )
}

export default List();
